import React, { Component } from 'react';

class WeatherIcon extends Component {
  componentDidMount() {
    const skycons = new Skycons({ color: 'pink' });
    skycons.add(this.ref.current, Skycons.PARTLY_CLOUDY_DAY);
    skycons.play();
  }

  render() {
    return <div></div>;
  }
}
